function commentsGistCtrl($scope, $routeParams, ghAPI) {
        $scope.comments = [];
        ghAPI.comments($routeParams.gistId, function (response) {
            if (response.status === 200) {
                $scope.comments.push.apply($scope.comments, response.data);
            } else {
                
            }
        });

    $scope.add_comment = function(data){
        
        var comment = {
            "body": data
        };
        ghAPI.add_comment($routeParams.gistId, comment, function (response) {
            if (response.status === 201) {
                $scope.comments.push(response.data);
                $scope.gist.comments = $scope.gist.comments + 1;
                angular.element(document.querySelector('.comment-text')).val('');
                angular.element(document.querySelector('.show-preview')).html('');
            } else {
                
            }
        });
    };

    $scope.delete_comment = function(gist_id,comment_id,$index) {
        ghAPI.delete_comment(gist_id, comment_id, function (response) {
            if (response.status === 204) {
                $scope.gist.comments = $scope.gist.comments - 1;
                $scope.comments.splice($index,1);
                
            } else {
                
            }
        });
    };

}
'use strict';

function createGistCtrl($scope, $rootScope, ghAPI, gistData) {

    $scope.description = '';

    $scope.isPublic = false;
    $scope.files = [
        {
            filename: '',
            content: ''
        }
    ];

    $scope.addFile = function () {
        
        
        $scope.files.push({
            content: '',
            filename: '',
            language: 'html'
        });
    };

    $scope.deleteFile = function (index) {
        $scope.files.splice(index, 1);
    };

    $scope.enableEdit = function () {
        $rootScope.edit = true;
        $('.edit').slideDown('slow');
    };
    $scope.disableEdit = function () {
        $rootScope.edit = false;
        $('.edit').slideUp('slow');
    };

    $scope.dragStart = function (e) {
        e.stopPropagation();
        e.preventDefault();
        $('.drop').slideDown('slow');
        $('.main section').addClass('dragarea');
        
    };

    function addFileToScope(file) {
        var fileReader = new FileReader();

        fileReader.onloadend = (function (filename) {
            return function (event) {
                $scope.$apply(function () {
                    $scope.files.push({
                        filename: filename,
                        content: event.target.result,
                        language: 'html'
                    });
                });
            };
        })(file.name);

        fileReader.readAsText(file);
    }

    $scope.drop = function (e) {
        e.stopPropagation();
        e.preventDefault();
        var data = event.dataTransfer;
        for (var i = 0; i < data.files.length; i++) { // For each dropped file or directory

            $('.edit').slideUp('slow');
            $('.ok').slideDown('slow');
            $('.main section').removeClass('dragarea');

            var entry = data.items[i].webkitGetAsEntry(); // get file system entries

            if (entry.isFile) {
                addFileToScope(data.files[i]); // add the file to the gist scope
                $('.ok span').html('Dropped: <b>' + entry.name + '</b>');

            } else if (entry.isDirectory) {
                $('.ok span').html('Dropped Directory: <b>' + entry.name + '</b>');

                var reader = function readDirectory(entry) {

                    var directoryReader = entry.createReader();

                    directoryReader.readEntries(function (results) {
                        if (results.length) {
                            angular.forEach(results, function (resultEntry) {

                                if (resultEntry.isFile) {
                                    if (resultEntry.name === '.DS_Store') {
                                        return; // skip osx meta data fle
                                    }

                                    resultEntry.file(function (file) {
                                        addFileToScope(file);
                                    });
                                } else {
                                    // another directory call self with the new directory
                                    readDirectory(resultEntry);
                                }
                            });
                        }
                    });
                }(entry); //self execute for the first time
            }
            $rootScope.$apply(function() {
                $('.drop').slideUp('slow');
                $rootScope.edit = true;
                $('.edit').slideDown('slow');
            });

        }
    };

    $scope.dragEnd = function (e) {
        e.stopPropagation();
        e.preventDefault();
        //$('.ok').slideUp('slow');
        
    };

    $scope.save = function ($event) {

        if ($event) {
            $event.preventDefault();
        }

        var data = {
            description: $scope.description,
            "public": $scope.isPublic,
            files: {}
        };

        for (var file in $scope.files) {
            data.files[$scope.files[file].filename] = {
                content: $scope.files[file].content
            };
        }

        ghAPI.create(data, function (response) {
            if (response.status === 201) {

                var newGist = {
                    id: response.data.id,
                    description: $scope.description,
                    "public": $scope.isPublic,
                    files: {}
                };
                $rootScope.edit = false;
                $('.ok').slideDown('slow');
                $('.ok span').text('Gist saved');
                newGist.tags = $scope.description ? $scope.description.match(/(#[A-Za-z0-9\-\_]+)/g) : [];
                gistData.list.unshift(newGist);

                window.location.href = "#/gist/" + response.data.id;
            }
        });
    };
}
function footerCtrl($scope) {
    $scope.theDate = Date.now();
}
'use strict';

function headerController($scope, notificationService, $location, appSettings, gistData, onlineStatus, $rootScope) {

    notificationService.login();

    notificationService.forward('receiveNotification', $scope);
    notificationService.forward('notificationRead', $scope);
    notificationService.forward('identify', $scope);
    notificationService.forward('disconnect', $scope);

    $scope.settings = appSettings.data;

    $scope.notifications = notificationService.notifications;

    $scope.logOut = function () {

        
        $rootScope.gistoReady = false;
        $scope.notifications.length = 0;
        notificationService.logout();

        gistData.list = [];
        appSettings.logOut();
    };

    $scope.onlineStatus = onlineStatus;

    $scope.$watch('onlineStatus.isOnline()', function(online) {
       if (online && window.ioSocket && (!window.ioSocket.socket.connected || !window.ioSocket.socket.reconnecting) ) {
           notificationService.login();
       } else if (!online) {
           notificationService.disconnected();
       }
    });

    $scope.$on('socket:disconnect', function(e) {
       
        notificationService.disconnected();
    });

    $scope.$on('socket:identify', function(e, data) {
        // identify to the server
        
        notificationService.register();

    });

    $scope.$on('socket:receiveNotification', function(e, data) {
        
        notificationService.add(data);
        
    });

    $scope.$on('socket:notificationRead', function(e, data) {
        // remove read notification
        
        (data && data.gistId) && notificationService.remove(data.gistId);
    });

    $scope.loadExternalGist = function(id, user) {
        $location.url('/shared/' + user + '/' + id);
    };

    $scope.reject = function(id) {
        
        notificationService.remove(id);
        notificationService.send('notificationRead', {gistId: id});
    };

}
'use strict';

function listGistCtrl($scope, ghAPI, gistData, notificationService) {
    $scope.gists = gistData.list;
    $scope.onlineStatus = {
       state: "Offline",
       status: false
    };

    $scope.$on('ApplicationState', function(e, data) {
        
        $scope.onlineStatus.state = data.online ? "Online" : "Offline";
        $scope.onlineStatus.status = data.online;

    }, true);

    // Get the gists list
    if ($scope.gists.hasOwnProperty('lastUpdated')) {
        
        var now = new Date();
        var seconds = Math.round((now.getTime() - $scope.gists.lastUpdated.getTime()) / 1000);
        
        if (seconds > 60) {
            ghAPI.gists();
        }
    } else {
        ghAPI.gists();
    }
}
